// Review.tsx
import React from 'react';
import './review.css';

interface ReviewProps {
  name: string;
  description: string;
  photo: string;
}

const Review: React.FC<ReviewProps> = ({ name, description, photo }) => {
  return (
    <div className="review-item">
      <div className="image-column">
        <img src={photo} alt="Review" className="review-photo" />
      </div>
      <div className="info-column">
        <h3>{name}</h3>
        <p>{description}</p>
      </div>
    </div>
  );
};

export default Review;
